<!DOCTYPE html>
<html>
<head>
    <title>PermRLE</title>
    <style type="text/css">
    #input { float: left;  }
    #submit { float: left; }
    #output { float: left; }
    .clear { clear: left; }
    </style>
    <script type="text/javascript">
    // Read the contest analysis for full explanation. It's quite elaborate.

    var INF = 50000;

    function new2DArray(h, w, value) {
        var a = new Array(h);
        for (var y = 0; y < h; y++) {
            a[y] = new Array(w);
            for (var x = 0; x < w; x++) {
                a[y][x] = value;
            }
        }
        return a;
    }

    function clone2DArray(b) {
        var h = b.length, w = b[0].length;
        var a = new Array(h);
        for (var y = 0; y < h; y++) {
            a[y] = new Array(w);
            for (var x = 0; x < w; x++) {
                a[y][x] = b[y][x];
            }
        }
        return a;
    }    

    // There are more micro optimizations than I would like here but they are
    // actually necessary to solve the large input in a timely manner.

    function hamilton(g, last) {
        var N = g.length;
        var M = 1 << N;
        var dp = new2DArray(M, N, INF);
        for (var mask = 1, n = 0; mask < M; mask++) {
            if (mask >= (1 << (n + 1))) {
                n++; // n is the position of highest bit in mask
            }
            if ((mask ^ (1 << n)) == 0) {
                dp[mask][n] = g[n][last];
                continue;
            }
            for (var u = 0; u <= n; u++) {
                if ((mask & (1 << u)) == 0) {
                    continue;
                }
                var rest = mask ^ (1 << u);
                for (var v = 0; v <= n; v++) {
                    if (v == u || (mask & (1 << v)) == 0) {
                        continue;
                    }
                    var cur = g[u][v] + dp[rest][v];
                    if (dp[mask][u] > cur) {
                        dp[mask][u] = cur;
                    }
                }
            }
        }
        return dp[M - 1][last];
    }

    function precompute(k, S) {
        var g = new2DArray(k, k, INF);
        for (var u = 0; u < k - 1; u++) {
            for (var v = u + 1; v < k; v++) {
                var sum = 0;
                for (var start = 0; start < S.length; start += k) {
                    if (S[start + u] != S[start + v]) {
                        sum++;
                    }
                }
                g[u][v] = sum;
                g[v][u] = sum;
            }
        }
        return g;
    }

    function buildGraph(pre, k, S, last) {
        var g = clone2DArray(pre);
        for (var v = 0; v < k; v++) {
            if (v == last) continue;
            var sum = 1;
            for (var start = 0; start + k < S.length; start += k) {
               if (S[start + last] != S[start + k + v]) {
                    sum++;
                }
            }
            g[last][v] = sum;
        }
        return g;
    }

    function solve(k, S) {
        var min = S.length;
        var pre = precompute(k, S);
        for (var last = 0; last != k; last++) {
            var g = buildGraph(pre, k, S, last);
            min = Math.min(min, hamilton(g, last));
        }
        return min;
    }

    function Problem() {
        this.k = 0;
        this.S = "";
    }

    function parse(input) {
        var probs = [];
        var lines = input.split(/\n/);
        var nCase = parseInt(lines[0]);
        for (var i = 0; i < nCase; i++) {
            var prob = new Problem();
            prob.k = parseInt(lines[2 * i + 1]);
            prob.S = lines[2 * i + 2];
            probs.push(prob);
        }
        return probs;
    }

    function process(probs) {
        return probs.map(function(x, i) {
            return "Case #" + (i + 1) + ": " + solve(x.k, x.S);
        }).join("\n");
    }

    function main() {
        var input = document.getElementById("input");
        var output = document.getElementById("output");
        var before = Date.now();
        output.value = process(parse(input.value));
        document.getElementById("timer").innerText = (Date.now() - before) + "ms";
    }
    </script>
